package repositories.image;


import com.google.common.io.BaseEncoding;
import javafx.scene.image.Image;
import repositories.InMemoryAbstractRepository;

import java.io.ByteArrayInputStream;
import java.util.*;

public final class InMemoryImageRepository extends InMemoryAbstractRepository implements IImageRepository {
	// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *
	// Static invariables - https://github.com/google/material-design-icons
	//
	private static final String BROWSER_CHROME = "";
	
	
	// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *
	// Static variables
	//
	private static final Map<String, Image> images = new HashMap<>();
	
	
	
	// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *
	// Main constructor
	//
	public InMemoryImageRepository()
	{
		try {
			//testing if images are working
			byte[] imageBytes = BaseEncoding.base64().decode(BROWSER_CHROME);
			Image image = new Image(new ByteArrayInputStream(imageBytes), 25, 25, true, true);
			
			addImage("BROWSER_CHROME", image);
		}
		catch (Exception err) {
			System.out.println(err.getLocalizedMessage());
		}
	}
	
	
	
	// * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * *
	// Methods
	//
	@Override
	public Map<String, Image> all() {
		if ( !(images != null && !images.isEmpty()) ){
			return null;
		}
		
		Map<String, Image> imageMap = new HashMap<String, Image>();
		
		for(String key : images.keySet()){
			imageMap.put(key,imageMap.get(key));
		}
		
		return imageMap;
	}
	
	@Override
	public Image addImage(String key, Image image) {
		if ( !(images != null && image != null && key != null && !key.isEmpty()) ){
			return null;
		}
		
		return images.put(key, image);
	}
	
	@Override
	public Image deleteImage(String key) {
		if ( !(images != null && !images.isEmpty() && key != null && !key.isEmpty()) ){
			return null;
		}
		
		return images.remove(key);
	}
	
	@Override
	public Image getImage(String key) {
		if ( !(images != null && !images.isEmpty() && key != null && !key.isEmpty()) ){
			System.out.println("no");
			return null;
		}
		System.out.println("yes");
		return images.get(key);
	}
}